import React from 'react';
import { Box, Typography, Container, Grid, Link } from '@mui/material';
import { styled } from '@mui/material/styles';

const FooterContainer = styled(Box)(({ theme }) => ({
  backgroundColor: theme.palette.primary.main,
  color: '#fff',
  padding: theme.spacing(6, 0),
  position: 'relative',
  '&::before': {
    content: '""',
    position: 'absolute',
    top: 0,
    left: 0,
    right: 0,
    height: '4px',
    background: `url('/wheat-border.png') repeat-x`,
    opacity: 0.2,
  },
}));

const FooterTitle = styled(Typography)(({ theme }) => ({
  fontFamily: '"Caveat", cursive',
  fontSize: '1.8rem',
  marginBottom: theme.spacing(2),
}));

const FooterLink = styled(Link)(({ theme }) => ({
  color: '#fff',
  textDecoration: 'none',
  display: 'block',
  marginBottom: theme.spacing(1),
  fontFamily: '"Quicksand", sans-serif',
  '&:hover': {
    color: theme.palette.secondary.main,
  },
}));

const SocialIcon = styled(Box)(({ theme }) => ({
  width: '32px',
  height: '32px',
  marginRight: theme.spacing(2),
  cursor: 'pointer',
  transition: 'transform 0.3s ease',
  '&:hover': {
    transform: 'scale(1.1)',
  },
}));

const Footer: React.FC = () => {
  return (
    <FooterContainer>
      <Container>
        <Grid container spacing={4}>
          <Grid item xs={12} md={4}>
            <FooterTitle variant="h3">Sweets You Knead</FooterTitle>
            <Typography variant="body1" sx={{ mb: 2 }}>
              Bringing warmth and joy through our artisanal baked goods since 2010.
            </Typography>
            <Box sx={{ display: 'flex', mt: 2 }}>
              <SocialIcon component="img" src="/facebook-icon.png" alt="Facebook" />
              <SocialIcon component="img" src="/instagram-icon.png" alt="Instagram" />
              <SocialIcon component="img" src="/twitter-icon.png" alt="Twitter" />
            </Box>
          </Grid>
          <Grid item xs={12} md={4}>
            <FooterTitle variant="h3">Quick Links</FooterTitle>
            <FooterLink href="#">Home</FooterLink>
            <FooterLink href="#">Menu</FooterLink>
            <FooterLink href="#">Our Story</FooterLink>
            <FooterLink href="#">Contact</FooterLink>
          </Grid>
          <Grid item xs={12} md={4}>
            <FooterTitle variant="h3">Newsletter</FooterTitle>
            <Typography variant="body1" sx={{ mb: 2 }}>
              Subscribe to receive updates on our latest creations and special offers.
            </Typography>
            <Box
              component="form"
              sx={{
                display: 'flex',
                gap: 1,
              }}
            >
              <input
                type="email"
                placeholder="Your email"
                style={{
                  padding: '8px 12px',
                  borderRadius: '4px',
                  border: 'none',
                  flex: 1,
                }}
              />
              <button
                style={{
                  padding: '8px 16px',
                  backgroundColor: '#DEB887',
                  border: 'none',
                  borderRadius: '4px',
                  color: '#fff',
                  cursor: 'pointer',
                  fontFamily: '"Quicksand", sans-serif',
                }}
              >
                Subscribe
              </button>
            </Box>
          </Grid>
        </Grid>
        <Box
          sx={{
            mt: 4,
            pt: 2,
            borderTop: '1px solid rgba(255,255,255,0.1)',
            textAlign: 'center',
          }}
        >
          <Typography variant="body2">
            © {new Date().getFullYear()} Sweets You Knead. All rights reserved.
          </Typography>
        </Box>
      </Container>
    </FooterContainer>
  );
};

export default Footer;
